UObject* WorldLocation = NULL;

UObject* WorldLocation = GetWorldLocation();

if (WorldLocation && IStaticMesh::StaticClass() == WorldLocation->GetClass())
{
	FString LocationName = WorldLocation->GetName();
	LocationName += "_StaticMeshComponent";
	SetStaticMeshComponentName(LocationName);
}
else
{
	FString LocationName = TEXT("Whatever");
	if (!WorldLocation) LocationName = TEXT("Null World Location");
	LocationName += "_Component";
	SetComponentName(LocationName);
}

UE_LOG(LogTemp, Warning, TEXT("WorldLocation: %s"), *LocationName);
